import React from 'react';
import { useQuery, gql } from '@apollo/client';

// Define your GraphQL query to fetch tables
const GET_TABLES = gql`
  query GetTable2 {
    Table2 {
      id
      bnb_name
    }
  }
`;

const MainPage = ({ username }) => {
  // Use useQuery hook to execute the GraphQL query
  const { loading, error, data } = useQuery(GET_TABLES);

  if (loading) return <p>Loading...</p>;
  if (error) return <p>Error: {error.message}</p>;

  return (
    <div className="table-container">
          <table className="data-table">
            <thead>
              <tr>
                <th>ID</th>
                <th>BNB Name</th>
              </tr>
            </thead>
            <tbody>
              {data.Table2.map(item => (
                <tr key={item.id}>
                  <td className="left-align">{item.id}</td>
                  <td className="left-align">{item.bnb_name}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
  );
};

export default MainPage;
